import { BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const Dashboard = () => {
  const data = [
    {
      name: 'Page A',
      uv: 4000,
      pv: 2400,
      amt: 2400,
    },
    {
      name: 'Page B',
      uv: 3000,
      pv: 1398,
      amt: 2210,
    },
    {
      name: 'Page C',
      uv: 2000,
      pv: 9800,
      amt: 2290,
    },
    {
      name: 'Page D',
      uv: 2780,
      pv: 3908,
      amt: 2000,
    },
    {
      name: 'Page E',
      uv: 1890,
      pv: 4800,
      amt: 2181,
    },
    {
      name: 'Page F',
      uv: 2390,
      pv: 3800,
      amt: 2500,
    },
    {
      name: 'Page G',
      uv: 3490,
      pv: 4300,
      amt: 2100,
    },
  ];
  return (
    <>
      <div className="dashS d-flex justify-content-around mt-5">
        <div className="statics">a</div>
        <div className="statics">b</div>
        <div className="statics">c</div>
      </div>
      <div className="dashG d-flex justify-content-around mt-5">
        <div className="staG">


        <BarChart data={data}>
          <Bar dataKey="uv" fill="#8884d8" />
        </BarChart>
        </div>
        <div className="staG"></div>
      </div>
    </>
  );
};

export default Dashboard;
